      transition: all 0.3s;

      @include onDesktop {
        font-size: 18px;
      }

      @include onTablet {
        font-size: 18px;
      }

      &:hover {
        color: $blackTextColor;
        padding-bottom: 10px;
        border-bottom: 1px solid $blackTextColor;
      }

      &--target {
        color: $blackTextColor;
        padding-bottom: 10px;
        border-bottom: 1px solid $blackTextColor;
      }

      &:target {
        color: $blackTextColor;
        padding-bottom: 10px;
        border-bottom: 1px solid $blackTextColor;
      }
    }
  }

  &__cards-container {
    width: 100%;
    overflow: hidden;
    box-sizing: border-box;
  }

  &__cards {
    display: flex;
    justify-content: center;
    gap: 20px;
    margin-bottom: 50px;
    transition: all 0.3s;
    transform: translateX(161%);

    @include onTablet {
      justify-content: justify-content;
      transform: translateX(156%);
    }

    @include onDesktop {
      justify-content: justify-content;
      transform: translateX(156%);
    }
  }

  &__card {
    flex: 0 0 100%;
    max-width: 100%;

    @include onTablet {
      flex: 0 0 50%;
      max-width: 50%;
    }

    @include onDesktop {
      flex: 0 0 50%;
      max-width: 50%;
    }

    &-img {
      width: 100%;
      margin-bottom: 20px;

      transition: all 0.3s;
      &:hover {
        scale: 105%;
      }
    }

    &-title {
      font-weight: 600;
      font-size: 18px;
      line-height: 150%;
      letter-spacing: 0.05em;
      text-transform: uppercase;
      color: $blackTextColor;

      margin-bottom: 10px;

      @include onTablet {
        margin-bottom: 15px;
      }

      @include onDesktop {
        margin-bottom: 15px;
      }
    }

    &-price {
      font-weight: 500;
      font-size: 18px;
      line-height: 150%;
      letter-spacing: 0.05em;
      text-transform: uppercase;
      color: $blackTextColor;
    }
  }

  &__button {
    margin: 0 auto;
  }

  &__decor {
    position: relative;
    top: 60px;
  }
}

