sources.styles/footer.scss:
.footer {
  background-color: $greenBgColor;
  opacity: 0.5;
  padding: 30px 0;

  @include onDesktop {
    padding: 60px 0;
  }

  &__container {
    position: relative;
    height: 407px;

    @include onTablet {
      height: 220px;
    }

    @include onDesktop {
      height: max-content;
    }
  }

  &__social {
    display: flex;
    gap: 20px;

    &--li {
      margin-top: 10px;

      @include onTablet {
        margin-top: 5px;
      }

      @include onDesktop {
        display: none;
      }
    }

    &--desk {
      display: none;

      @include onDesktop {
        display: flex;
        margin-top: 10px;
      }
    }

    &-link {
      display: block;
      width: 20px;
      height: 21px;
      transition: all 0.3s;

      &:hover {
        scale: 120%;
      }

      &--face {
        background-image: url(../images/facebook.svg);
        background-repeat: no-repeat;
        background-position: center;
      }

      &--inst {
        background-image: url(../images/instagram.svg);
        background-repeat: no-repeat;
        background-position: center;
      }
    }
  }

  &__nav {
    display: flex;
    flex-direction: column;
    list-style: none;
    gap: 10px;
    padding: 0;
    margin-bottom: 40px;

    @include onTablet {
      gap: 15px;
      margin-bottom: 0;
    }

    @include onDesktop {
      flex-direction: row;
      gap: 40px;
      margin-bottom: 0;
    }

    &-link {
      font-weight: 500;
      font-size: 18px;
      line-height: 150%;
      text-transform: capitalize;
      color: $whiteTextColor;
      text-decoration: none;

      @include onTablet {
        font-size: 14px;
        font-weight: 400;
      }

      &:hover {
        text-decoration: underline;
      }
    }
  }

  &__info {
    display: flex;
    flex-direction: column;
    gap: 10px;
    position: relative;

    @include onTablet {
      gap: 7px;
    }

    @include onDesktop {
      transform: translateY(-24px);
      gap: 20px;
    }

    &-link {
      text-decoration: none;
      color: $whiteTextColor;
      font-weight: 400;
      font-size: 14px;
      line-height: 150%;

      @include onDesktop {
        font-size: 16px;
      }

      &:hover {
        text-decoration: underline;
      }
    }
  }

  &__credits {
    font-weight: 400;
    font-size: 14px;
    line-height: 150%;
    color: $whiteTextColor;
    position: absolute;
    bottom: 0;
    left: 50%;
    transform: translate(-50%);
    text-align: center;

    @include onTablet {
      position: absolute;
      bottom: 0;
      left: 27px;
      transform: translate(0);
      text-align: left;
    }

    @include onDesktop {
      position: relative;
      margin-top: 160px;
      text-align-last: left;
    }
  }
}

sources.styles/main.scss:
@import "variables";
@import "mixins";

@import "./normalize.scss";

@import "./page.scss";
@import "./header.scss";
@import "./topAction.scss";
@import "./container.scss";
@import "./grid.scss";
@import "./button.scss";
@import "./menu.scss";
@import "./alert.scss";
@import "./decor.scss";
@import "./about.scss";
@import "./shop.scss";
@import "./creators.scss";
@import "./ingredients.scss";
@import "./contacts.scss";
@import "./form.scss";
@import "./footer.scss";

* {
  scroll-behavior: smooth;
}

.page__body {
  background-color: $mainBgColor;
  font-family: "Poppins", sans-serif;
}

.page__body:has(.menu:target) {
  overflow-y: hidden;
}

input:-webkit-autofill,
input:-webkit-autofill:hover,
input:-webkit-autofill:focus,
textarea:-webkit-autofill,
textarea:-webkit-autofill:hover,
textarea:-webkit-autofill:focus,
select:-webkit-autofill,
select:-webkit-autofill:hover,
select:-webkit-autofill:focus {
  -webkit-text-fill-color: $blackTextColor;
  -webkit-box-shadow: 0 0 0 1000px $mainBgColor inset;
  transition: background-color 5000s ease-in-out 0s;
}
